import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function PopisLovaca() {
    const [lovci, setLovci] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        const token = localStorage.getItem('token');
        const config = {
            headers: {
                'Authorization': `Bearer ${token}`
            }
        };

        axios.get('http://localhost:3000/popis-lovaca', config)
            .then(response => {
                if (response.data.error) {
                    console.error('Failed to fetch hunters:', response.data.message);
                    alert('Error: ' + response.data.message);
                } else {
                    setLovci(response.data.data);
                }
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    }, []);

    const handleDelete = (broj_lovacke_iskaznice) => {
        const token = localStorage.getItem('token');
        const config = {
            headers: {
                'Authorization': `Bearer ${token}`
            }
        };

        axios.delete(`http://localhost:3000/lovac/${broj_lovacke_iskaznice}`, config)
            .then(response => {
                if (response.data.error) {
                    console.error('Error deleting hunter:', response.data.message);
                    alert('Error deleting hunter: ' + response.data.message);
                } else {
                    // Remove the deleted hunter from the state array
                    setLovci(prevLovci => prevLovci.filter(lovac => lovac.broj_lovacke_iskaznice !== broj_lovacke_iskaznice));
                    console.log("Deleted successfully");
                }
            })
            .catch(error => {
                console.log(broj_lovacke_iskaznice)
                console.error('Error deleting hunter:', error);
                alert('Error deleting hunter');
            });
    };

    const buttonStyle = {
        padding: '20px 50px',
        fontSize: '12px',
        color: 'white',
        backgroundColor: '#FF6347',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer'
    };

    const tableStyle = {
        width: '100%',
        borderCollapse: 'collapse',
        boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
        backgroundColor: '#f7f7f7'
    };

    const thTdStyle = {
        border: '1px solid #ccc',
        padding: '10px',
        textAlign: 'left'
    };

    return (
        <div>
            <h1>Popis Lovaca</h1>
            <table>
                <thead>
                    <tr>
                        <th>Broj iskaznice</th>
                        <th>Ime</th>
                        <th>Prezime</th>
                        <th>Adresa</th>
                        <th>Datum rođenja</th>
                        <th>Kontakt</th>
                        <th>Korisničko ime</th>
                        <th>Uloga</th>
                        <th>Akcije</th>
                    </tr>
                </thead>
                <tbody>
                    {lovci.map((lovac) => (
                        <tr key={lovac.broj_lovacke_iskaznice}>
                            <td>{lovac.broj_lovacke_iskaznice}</td>
                            <td>{lovac.ime}</td>
                            <td>{lovac.prezime}</td>
                            <td>{lovac.adresa}</td>
                            <td>{lovac.datum_rodjenja}</td>
                            <td>{lovac.kontakt}</td>
                            <td>{lovac.korisnicko_ime}</td>
                            <td>{lovac.uloga}</td>
                            <td><button onClick={() => handleDelete(lovac.broj_lovacke_iskaznice)}>Delete</button></td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default PopisLovaca;
